import { useState, useEffect } from 'react';
import { useNavigate } from "react-router-dom";
function Home() {
    const naruto= 'data:image/jpeg;base64,'
    const kakashi= 'data:image/jpeg;base64,'
    const gaara= 'data:image/jpeg;base64,'
    const orochimaru= 'data:image/jpeg;base64,'
    const sasuke= 'data:image/jpeg;base64,'
    const jiraiya= 'data:image/jpeg;base64,'
    const kiba= 'data:image/jpeg;base64,'
    const choji= 'data:image/jpeg;base64,'


    const quiz =[[{pergunta:'você é frio e calculista'}],[{pergunta:'você gosta de passear com animais ?'},{pergunta:'se você fosse um prefeito você colocaria seus amigos para trabalhar na prefeitura ?',nao:choji,sim:naruto},{pergunta:'você gosta de fanfic ?',nao:kiba,sim:jiraiya}],[{pergunta:'você se importa com o certo e o errado ?'},{pergunta:'você curte maquiagem ?',nao:sasuke,sim:orochimaru},{pergunta:'você tem boas memórias com Linkin Park ?',nao:gaara,sim:kakashi}]]
    const [I,setIi] =useState(0)
    const [J,setJj] =useState(0)
    const [Fase,setFase] =useState(0)
    const [Nome,setNome] =useState('45')
    function resultado(i,j,r){
        if(i==0){
            setJj(0)
            setFase(1)
            if(r=='n'){
                setIi(1)
            }else{
                setIi(2)
            }
        }
        if(Fase ==1){
            setFase(2)
            if(r=='n'){
                setJj(1)
            }else{
                setJj(2)
            }
        }
        if(Fase ==2){
            if(r=='n'){
                setNome(quiz[I][J].nao)
            }else{
                setNome(quiz[I][J].sim)
            }
            setFase(3)
            
        }

    }
    return(
        <div className='body'>
            <div className='inf'>
                
                <h1 className={Fase <3 ? '': 'nome'}>Qual personagem de NARUTO você seria ?</h1>
                <h1 className={Fase <3 ? 'nome': ''}> VOCÊ SERIA</h1>
                <p className={Fase <3 ? '': 'nome'} >{quiz[I][J].pergunta}</p>

                <div className={Fase <3 ? '': 'nome'}>
                    <button className='botao' onClick={()=>resultado(I,J,'n')}>NÃO</button>
                    <button className='botao'  onClick={()=>resultado(I,J,'s')}>SIM</button>

                </div>
                <div className={Fase <3 ? 'nome': ''}>
                    <img src={Nome}></img>
                    
                </div>
                

            </div>
        </div>
    );
}
export default Home;